import React from 'react';
import './product-item.css';

const ProductItem = ({ barcode, amount }) => {
  return (
    <div className="product-item">
      <span>BARCODE: {barcode}</span>
      <span>AMOUNT: {amount}</span>
    </div>
  )
};

export default ProductItem;
